import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react'
import ProductCard from './components/ProductCard';
import Header from './components/Header';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import Saved from './components/Pages/SavedMovies';
import Search from './components/Pages/SearchMovies';
import Login from './components/Pages/LoginLogout';
import "./App.css";


const App = () => {
  return (
<div>
  <BrowserRouter>
  <Routes>
    <Route path="/Movies" element={<Saved/>} />
    <Route path="/Search" element={<Search/>} />
    <Route path="/Login" element={<Login/>} />
    <div className="w-full bg-white">
      <NavBar />
      <Header />
      <div className="lg:flex mt-10 justify-center sm:flex-row ">
        <ProductCard />
        <ProductCard />
        <ProductCard />
      </div>
      <Footer/>
    </div>
    </Routes>
    </BrowserRouter>
</div>

  )
}

export default App
